p2.U(null,new R(null,2,5,S,[tv,vB],null),function(){return"\n#### Game Upload Format\n\nOur servers are supposed to accept Go games in SGF format that satisfy the following conditions:\n* Even games only, no handicap\n* Alternating black and white moves\n* No illegal moves\n* No variations\n* No more than 400 moves played\n\nIf you think your upload has been rejected by mistake, please contact us and we will investigate the issue and, in case we conclude it really is a server problem, try to fix it.\n\n#### Analysis Limitations\nEspecially keep in mind that our AI:\n* Might be very wrong when ladders are involved.\n* Always assumes games wer played with area scoring and 7.5 points komi - even if the uploaded file contains different values.\n"});
